import React from 'react'

export default function random(num1, num2){
    if (num1 > num2){
        const min = Math.ceil(num1.numero1)
        const max = Math.floor(num2.numero2)
        const aleatorio = Math.random(min,max)
        return (
        <div>
            <p>{aleatorio}</p>
        </div>
        )
    }else{
        const min = Math.ceil(num2.numero2)
        const max = Math.floor(num1.numero1)
        const aleatorio = Math.random(min,max)
        return (
        <div>
            <p>{aleatorio}</p>
        </div>
        )
    }
    const aleatorio = Math.random(min,max)
    return (
    <div>
        <p>{aleatorio}</p>
    </div>
    )
}
